import logo from './logo.svg';
import './App.css';
import Item from './MyItem'
import React from 'react';

class StarWars extends React.Component {
  getNewCharacter(){
    console.log("Get New Character")
  }

  render(){
    return(
      <div>
        <h1>Name</h1>
        <p>Height</p>
        <p>Homeworld: URL</p>
        <ul>
          <li>Films</li>
        </ul>
        <button type="button" 
        onClick={()=> this.getNewCharacter()} 
        className="btn"
        >Randomize Character</button>
      </div>
    )
  }
}






function App() {
  return (
    <div className="App">
      <header className="App-header">
        <StarWars/>
      </header>
    </div>
  );
}

export default App;
